function center_x(team_num) {


  var divide_num = Number(team_num) + 1;

  const start = 200;
  const increment = 300;




  if (divide_num % 4 == 1) {

    return start; // 250 px between the squares

  }


  if (divide_num % 4 == 2) {

    return start + (increment);

  }

  if (divide_num % 4 == 3) {

    return start + (increment * 2);

  }

  if (divide_num % 4 == 0) {

    return start + (increment * 3);

  }




}


function center_y(team_num, conf_num) {


  var id_column = Math.floor(team_num / 4) * 300

  return (conf_y[conf_num].position) + id_column;


}








function Getfill(i) {

  if (json[i].ortg >= 112.5) {

  return "#30cc5a";


  }

  if (112.5 > json[i].ortg && json[i].ortg >= 106) {

  return "#2f9e4f";


  }

  if (106 > json[i].ortg && json[i].ortg >= 99.5) {

  return "#35764e";


  }

  if (99.5 > json[i].ortg && json[i].ortg >= 93) {

  return "#8b444e";


  }

  if (93 > json[i].ortg && json[i].ortg >= 86.5) {

  return "#bf4045";


  }

  if (86.5 > json[i].ortg) {

  return "#f63538";


  }

}




function Getcoords(d, center_x, center_y) {
  if (d.id == 0) {

  return [center_x - d.size + 2, center_y - d.size + 2, d.size - 2];

  }

  if (d.id == 1) {

  return [center_x + 2, center_y - d.size + 2, d.size - 2];

  }

  if (d.id == 2) {

  return [center_x + 2, center_y + 2, d.size - 2];

  }

  if (d.id == 3) {

  return [center_x - d.size + 2, center_y + 2, d.size - 2];

  }

  if (d.id == 4) {

  console.log(json[Number(d.player_num)].player_name);
  console.log(json[Number(d.player_num) - 3].player_name);


  return [center_x + 2, center_y  - d.size - json[Number(d.player_num) - 3].size + 2, d.size - 2];

  }

  if (d.id == 5) {

  return [center_x  + json[Number(d.player_num) - 4].size + 2, center_y - d.size + 2, d.size - 2];

  }

  if (d.id == 6) {

  return [center_x  + json[Number(d.player_num) - 4].size + 2, center_y + 2, d.size - 2];

  }

  if (d.id == 7) {

  return [center_x + 2, center_y  + json[Number(d.player_num) - 5].size + 2, d.size - 2];

  }

  if (d.id == 8) {

  return [center_x - d.size + 2, center_y  + json[Number(d.player_num) - 5].size + 2, d.size - 2];

  }

  if (d.id == 9) {

  return [center_x - d.size - json[Number(d.player_num) - 6].size + 2, center_y + 2, d.size - 2];

  }

  if (d.id == 10) {

  return [center_x - d.size - json[Number(d.player_num) - 10].size + 2, center_y - d.size + 2, d.size - 2];

  }

  if (d.id == 11) {

  return [center_x - d.size  + 2, center_y - d.size - json[Number(d.player_num) - 11].size + 2, d.size - 2];

  }

  if (d.id == 12) {

  return [center_x + 2, center_y - d.size - json[Number(d.player_num) - 11].size - json[Number(d.player_num) - 8].size + 2, d.size - 2];

  }


}


